import React from 'react';
import { Player, PlayerPosition, SeasonSelection } from '../types/PlayerDashboardTypes';
import QBDashboardContainer from '../containers/QBDashboardContainer';
import styles from './PlayerDashboardContainer.module.css';
import SeasonSelector from '../components/SeasonSelectorComponent';

type PlayerDashboardProps = {
  player: Player
}

const ONE_SEASON = [2019];
const THREE_SEASONS = [2019, 2018, 2017];

export default ({ player }: PlayerDashboardProps) => {
  const { firstName, lastName, primaryPosition } = player.demographicData;
  const oneSeasonGames = player.playerGames.filter((game) => game.seasonYear in ONE_SEASON);
  const threeSeasonGames = player.playerGames.filter((game) => game.seasonYear in THREE_SEASONS);

  const onSeasonSelection = (selection: SeasonSelection) => {

  }

  return (
    <div>
      <h1 className={styles.title}>{firstName} {lastName} {primaryPosition} Dashboard</h1>
      <SeasonSelector onStateChange={onSeasonSelection} />
      {renderDashboard(player)}
    </div>
  )
}

function isGameInSelection(player: Player, selection: SeasonSelection): boolean {
  if (selection === SeasonSelection.One) {
    return game.seasonYear
  }
}

function renderDashboard(player: Player) {
  if (player.demographicData.primaryPosition === PlayerPosition.Quarterback) {
    return <QBDashboardContainer player={player} />
  }
}
